import React from 'react'
import {connect} from 'react-redux'


class Destinations extends React.Component {

    renderDestinations = () => {
        return this.props.destinations.map(student => (
          <p onClick={() => this.props.removeStudent(student)}>Name: {student.name} | Age: {student.age} | Avg Grade: {student.grade}</p>
        ))
      }

    render() {
        return (
            <div>
                Places I've Traveled To
                {console.log(this.props.destinations)}
                {this.renderDestinations()}
           
            </div>
        )
    }
}

const mapStateToProps = state => {
    return {destinations: state.destinations}
}

export default connect(mapStateToProps)(Destinations)
